import { useHistory } from 'react-router-dom';

export function CartItem (){
    const history = useHistory();
    console.log( localStorage.token )
return(
    <>
    {localStorage.token &&
    <div className="container">
        <div className="h-100 w-100 bg-success my-auto">
        <div className=" bg-dark d-flex align-content-center justify-content-center align-items-center my-auto">
            <div className="bg-info flex-grow-1">
                <h1>Shopping Cart</h1>
            </div>
            <div className="bg-success">
                <h2>Summary</h2>
            </div>
        </div>
        </div>
    </div>
     }
     {!localStorage.token &&
      history.push("/Login")
     }
   
    </>
);
}
